import React from "react";

const Persons = ({ persons, deletePerson }) => {
  return persons.map((person) => (
    <p key={person.id}>
      {person.name} {person.number}
      <button onClick={() => deletePerson(person.id)}>delete</button>
    </p>
  ));
};

export default Persons;
